- proto: Paper
  entities:
  - uid: 16594
    components:
    - desc: Nobody forces you to read it, you decide for yourself if you will or won't.
      name: unaddressed letter
      type: MetaData
    - rot: -1.5707963267948966 rad
      pos: -9.60897,1.5066981
      parent: 2
      type: Transform
    - content: >-
        The forest hardly changes
            given any amount of time;
        a bird can caw, a branch could fall,
            but it'd still remain sublime.

        The forest sometimes changes
            as the years go by;
        a seed that is placed, soon becomes a new face
            in a world where it lives and dies.

        The forest always changes
            despite what I may say.
        As generations pass, the forest lasts
            to be enjoyed by another that day.


        Edge Station was made possible with the help of Scientist, Redsky, ps3moira, and contributors in the #mapping channel in the Delta V discord.


        Thank you for playing on Edge!
            - Colin_Tel
      type: Paper
